import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    modal: {
        justifyContent: 'flex-end',
        margin: 0,
        position: 'absolute',
        right: 0,
        bottom: 0,
        width: '20%',
        height: '50%'
    },
    modalContent: {
        backgroundColor: 'white',
        padding: 22,
        borderRadius: 4,
        borderColor: 'rgba(0, 0, 0, 0.1)'
    }
});
